$.au1=A.a(["\uc0bc\uad6d\uc2dc\ub300 \uc2e0\ub77c\uc758 \uc81c5\ub300 \ud30c\uc0ac\uc655 \ub2f9\uc2dc \ucd08\ucd95\ub41c \uac83\uc73c\ub85c \uc804\ud574\uc9c0\ub294 \uc131\uacfd\uc73c\ub85c \uac00\ud30c\ub974\uc9c0\ub9cc \ucc9c\ucc9c\ud788 \uc624\ub974\ub2e4\ubcf4\uba74 \uc0ac\uc9c4\uacfc \uac19\uc740  \uc591\ud3c9\uacfc \uc5ec\uc8fc \uc77c\ub300\uc758 \ub113\uc740 \uac15\uc548 \ucda9\uc801\ub300\uc9c0\ub97c \uac10\uc0c1\ud558\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\ud654\ub2f4\uc232\uc740 \uacc4\uace1\uacfc \uc0b0\uae30\uc2ad\uc744 \ub530\ub77c \uc232\uc774 \uc774\uc5b4\uc9c0\uace0, \uc0b0\ucc45\ub85c\ub294 \uacc4\ub2e8 \ub300\uc2e0 \uacbd\uc0ac\ub3c4\uac00 \ub0ae\uc740 \ub370\ud06c\uae38\ub85c \uc870\uc131\ub418\uc5b4 \uc788\uc5b4 \ub204\uad6c\ub098 \ud3b8\ud55c \uad00\ub78c\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4. (*\uc720\ubaa8\ucc28\ub098 \ud720\uccb4\uc5b4 \uad00\ub78c \uac00\ub2a5) \ubb34\uc5c7\ubcf4\ub2e4 \uce5c\ud658\uacbd \ubaa8\ub178\ub808\uc77c\uc774 \uc788\uc5b4 \ub178\uc57d\uc790\ub3c4 \ubd88\ud3b8\ud568 \uc5c6\uc774 \uc232\uc744 \uc870\ub9dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc790\uc5f0 \uc18d\uc5d0\uc11c \uc815\ub2e4\uc6b4 \ub300\ud654\ub97c \ub098\ub204\uba70 \ud654\ub2f4\uc232\ub9cc\uc758 \ub9e4\ub825\uc744 \ub290\uaef4\ubcf4\uc138\uc694.","\uc790\uc5f0 \uc18d \ud55c\uc801\ud55c \uc2dc\uace8\uae38\uc5d0 \uc790\ub9ac\uc7a1\uc740 \uc18c\uaddc\ubaa8 \uac24\ub7ec\ub9ac\ub85c \uc774\uad6d\uc801\uc778 \ub290\ub08c\uc740 \ubb3c\ub860 \uc18c\ubc15\ud55c \ub0ad\ub9cc\uacfc \uac10\uc131\uc774 \uacf5\uc874\ud558\ub294 \uacf3\uc785\ub2c8\ub2e4. \uc11c\uc6b8 \uadfc\uad50\uc5d0 \uc704\uce58\ud558\uc5ec \ub4dc\ub77c\uc774\ube0c \uacb8 \ubd80\ub2f4\uc5c6\uc774 \ub2e4\ub140\uc624\uae30 \uc88b\uc73c\uba70, \uce74\ud398\ub3c4 \uc6b4\uc601\ud558\uace0 \uc788\ub2f5\ub2c8\ub2e4."],t.m)
