$.au2=A.a(["\ub3d9\ud654 \uc18d \uc8fc\uc778\uacf5\uc774 \uc5b4\ub518\uac00\uc5d0 \uc788\uc744 \uac83\ub9cc \uac19\uc740 \ud48d\uacbd\uc744 \uc790\uc544\ub0b4\ub294 \uc774\uacf3\uc740 \ub2e4\uc591\ud55c \uaf43\ub4e4\uc774 \uac00\ub4dd\ud55c \ud568\uc591 \uc0c1\ub9bc\uacf5\uc6d0\uc785\ub2c8\ub2e4. \ucc9c\ucc9c\ud788 \uac78\uc73c\uba70 \uc544\ub984\ub2e4\uc6b4 \ucd94\uc5b5 \uc0ac\uc9c4 \ucc0d\uae30 \uc88b\uc740 \uc608\uc05c \uaf43\uae38\uc774 \ud3bc\uccd0\uc9c4 \uacf3\uc774\ub78d\ub2c8\ub2e4.","\uacbd\ub0a8 \ud568\uc591 \uc870\ub3d9\ub9c8\uc744\uc5d0\uc11c \uc9c0\ub9ac\uc0b0 \uc81c\uc77c\ubb38\uc73c\ub85c \uac00\ub294 \uace0\uac2f\uae38\uc778 \uc9c0\uc548\uc7ac\uc640 \uc624\ub3c4\uc7ac\ub97c \uc18c\uac1c\ud569\ub2c8\ub2e4. \ud55c\uad6d\uc758 \uc544\ub984\ub2e4\uc6b4 \uae38 100\uc120\uc5d0 \ub4f1\uc7a5\ud558\ub294 \ub4dc\ub77c\uc774\ube0c \uba85\uc18c\uc778 \uc9c0\uc548\uc7ac\ub294 \ud478\ub978 \uc794\ub514\ubc2d \uc0ac\uc774\ub85c \uad6c\ubd88\uad6c\ubd88\ud55c \ubaa8\uc591\uc73c\ub85c \ub9cc\ub4e4\uc5b4\uc9c4 \uae38\ub85c \ub9c8\uce68 \ubc40\uc744 \uc5f0\uc0c1\ucf00 \ud558\ub294 \uacf3\uc785\ub2c8\ub2e4. \uc774\uacf3\uc5d0\uc11c \uc57d 7\ubd84\ub9cc \ub354 \uac00\uba74 \ud734\uac8c\uc18c\uacfc \uc27c\ud130\uac00 \uc788\ub294\ub370 \uc774\uacf3\uc774 \ubc14\ub85c \uc624\ub3c4\uc7ac\ub77c\uace0 \ud558\ub294 \uacf3\uc785\ub2c8\ub2e4. \uc804\ub9dd\ub300\uc5d0\uc11c \uc9c0\ub9ac\uc0b0\uc758 \ud48d\uacbd\uc744 \uac10\uc0c1\ud574\ubcf4\uc138\uc694!","\ub0a8\uacc4\uc11c\uc6d0\uc740 \uc720\ub124\uc2a4\ucf54\uc138\uacc4\ubb38\ud654\uc720\uc0b0\uc5d0 \ub4f1\uc7ac\ub41c \uc5ed\uc0ac \uae4a\uc740 \uc11c\uc6d0\uc73c\ub85c \uace0\uc988\ub109\ud568\uc744 \ub290\ub084 \uc218 \uc788\ub294 \uacf3\uc785\ub2c8\ub2e4."],t.m)
