$.au4=A.a(["\uc0ac\uacc4\uc808 \uc6b8\ucc3d\ud55c \ub300\ub098\ubb34 \uc232\uc744 \ub9cc\ub0a0 \uc218 \uc788\ub294 \uc8fd\ub179\uc6d0\uc740 \ub300\ub098\ubb34\uac00 \uc11c\uc2dd\ud558\uae30 \uc88b\uc740 \ud658\uacbd\uc744 \uac16\ucd98 \ub2f4\uc591\uc5d0 \uc704\uce58\ud574 \uc788\uc2b5\ub2c8\ub2e4. \uc57d 1\uc2dc\uac04 30\ubd84\uc815\ub3c4 \uc18c\uc694\ub418\ub294 \uc0b0\ucc45\ub85c\ub97c \ub530\ub77c \uac77\ub2e4\ubcf4\uba74 \ub300\ub098\ubb34\uac00 \ubfdc\uc5b4\ub0b4\ub294 \ub9d1\uc740 \uae30\uc6b4\uc744 \ub290\ub07c\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\uc870\uad11\uc870\uc758 \uc81c\uc790 \uc591\uc0b0\ubcf4\uac00 \uc870\uc131\uc744 \uc2dc\uc791\ud574 \uadf8\uc758 \uc790\uc2dd, \uc190\uc790 \ub300\uc5d0 \uc774\ub974\ub7ec \uc644\uc131\ub41c \uac83\uc73c\ub85c \ucd94\uc815\ub418\ub294 \uc18c\uc1c4\uc6d0\uc740 \uc790\uc5f0\uacfc \uc778\uacf5\uc758 \uc808\ubb18\ud55c \uc870\ud654\uac00 \ube5a\uc5b4\ub0b4\ub294 \uc870\uacbd\uc744 \uac10\uc0c1\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ub300\ub098\ubb34, \ub9e4\ud654, \ub3d9\ubc31, \ubc30\ub871, \uce58\uc790, \uc0b0\uc218\uc720\uac00 \ucca0\ub9c8\ub2e4 \uaf43\uc744 \ud53c\uc6cc \uc5b8\uc81c \ucc3e\uc544\ub3c4 \uacc4\uc808\uc774 \uc624\ub86f\uc774 \ub290\uaef4\uc9c0\ub294 \uacf3\uc73c\ub85c \uacfc\uac70\uc5d0\ub294 \uc120\ube44\ub4e4\uc774 \ud604\uc7ac\ub294 \uc8fc\ubbfc\ub4e4\uc774 \ud734\uc2dd\uc744 \ucde8\ud558\ub294 \uc7a5\uc18c\ub85c \uc0ac\ub791\ubc1b\uace0 \uc788\uc2b5\ub2c8\ub2e4. ","\ub2f4\uc591\ucc9c\ubcc0\uc758 \uc81c\ubc29\uc778 \uad00\ubc29\uc81c\ub97c \ubcf4\ud638\ud558\uae30 \uc704\ud574 \ub9cc\ub4e4\uc5b4\uc9c4 \uc778\uacf5 \uc232\uc73c\ub85c \ucc9c\uc5f0\uc73c\ub85c \uc774\uacf3\uc5d0\uc11c\ub294 300\ub144\uc774 \ub118\uc740 \ub290\ud2f0\ub098\ubb34, \ud478\uc870\ub098\ubb34, \ubc9a\ub098\ubb34 \ub4f1 15\uc885\uc758 \ub099\uc5fd\uc131 \ud65c\uc5fd\uc218\ub97c \ub9cc\ub0a0 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud3c9\ud3c9\ud55c \uae38\uc744 \ub530\ub77c \ubb3c\uae38\uacfc \uc232\uae38\uc744 \ub9cc\ub084\ud560 \uc218 \uc788\uc5b4 \uc0b0\ucc45 \ucf54\uc2a4\ub85c \ud6cc\ub96d\ud569\ub2c8\ub2e4. "],t.m)
